4,'bubonic plague caused by the Black Death bacillus Yersinia pestis kills a third of the human population across much of Europe, 1346-53: originating in Kyrgyzstan or the Himalayas, transmitted by rats and their fleas',677),(15,'global population of humans passes 500 million: annual energy use per person averages 9,800 kWh, 14x the resting metabolism',481),(16,'World War I (1914-18): 32 nations participate, 20 million killed: declared the war to end war',109),(17,'World War II (1939-45): 184 nations participate, 60 million killed, including genocide of 6 million Jews in the Holocaust 1941-45 - the greatest crime of the 20th century',84),(18,'global population of humans passes 5 billion: annual energy use per person averages 18,300 kWh, 26x the resting metabolism',37),(19,'first assessment that global climate warming has begun (James Hansen, Senate testimony to US Congress, 23/6/1988) -> creation of the IPCC',35);
